import React from "react";
import '../style.css';
import Location from "./Location";

const Route = () => {
    return (
        <div className="route">
            <div>
                <button>Import</button><button>Export</button>

            </div>
            <Location icon={[<i class="fa fa-map-marker"></i>]} where ="From City or port" />
            <Location icon={[<i class="fa fa-map-marker"></i>]} where ="To City or Port" />
            <Location icon={[<i class="fa fa-map-marker"></i>]} where ="Ready Date" />
            <Location where ="From City or port" dropdown ="" />
            <Location icon={[<i class="fa fa-map-marker"></i>]} where ="From City or port" />

        </div>
    );
}

export default Route;
